import { setStatusBarBackgroundColor } from 'expo-status-bar';
import React from 'react'
import { View, Text,StyleSheet,Image,Button} from 'react-native'

export default function Fn() {
    return (
        <View>
    <Image
    source={{
    uri: 'data:image/jpeg;base64,',
  }}
          style={{ width: 200, height: 200 }}
        />
        <Image
    source={{
    uri: 'https://cdn.cdnparenting.com/articles/2019/01/15140938/450562021-H.jpg',
  }}
          style={{ width: 200, height: 200 }}
        />
        <Text style={styles.textStyle}>BABLU BANTHI</Text>
        <Button
  onPress={() => {
    alert('bablu touched the banthi!');
  }}
  title="Press Me"
/>
        </View>
    );
}
  const styles=StyleSheet.create({
  textStyle:{
      fontSize:30,
      backgroundColor:'#fff'
  }
  });
